package org.swtk.commons.dict.wiktionary.generated.b.l.i;  import java.util.Collection; import java.util.HashMap; import java.util.Map;  import org.swtk.common.dict.dto.wiktionary.Entry;  import com.trimc.blogger.commons.utils.GsonUtils;  public class WiktionaryBLI000 {  	private static Map<String, Entry> map = new HashMap<String, Entry>();  	static { 			add("blip", "{\"term\":\"blip\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"onomatopoeic|Onomatopoeic.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small dot registered on electronic equipment, such as a radar or oscilloscope screen\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Frederick Forsyth, \u0027The Fourth Protocol\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"When the \u0027\u0027blip\u0027\u0027 began to move up the oscilloscope screen, they followed again\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Asaf Degani, \u0027Taming HAL: Designing Interfaces Beyond 2001\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"At 6:45 pm, the chief officer saw a \u0027\u0027blip\u0027\u0027 on the radar, approximately seven nautical miles away\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A short sound of a single pitch, usually electronically generated\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Ken Norton, \u0027Going the Distance\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Blip\u0027\u0027..Blip..Blip..Blip \u0026amp;nbsp;There was that annoying noise again\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Richard Strozzi-Heckler, \u0027In Search of the Warrior Spirit: Teaching Awareness Disciplines to the Green Berets\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The little “\u0027\u0027blip\u0027\u0027” sound that happens when a balloon is shot down becomes a duet with the player. “Blip” “Damn!” “Blip” “Damn\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A brief and usually minor aberration or deviation from what is expected or normal\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Brett Grodeck, \u0027The First Year - HIV: An Essential Guide for the Newly Diagnosed\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"There\u0027s a chance this is just a viral \u0027\u0027blip\u0027\u0027, an intermittent spike of low-level virus that just happens in people on successful HIV treatment\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Dany Spencer Adams, \u0027Lab Math: A Handbook of Measurements, Calculations, and Other Quantitative Skills for Use at the Bench\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"As a cell moves through the aperture it causes a \u0027\u0027blip\u0027\u0027 (a brief change) in the voltage when the nonconductive cell briefly displaces the conductive medium\", \"priority\":15}]}, \"synonyms\":{}}");

	add("bliaut", "{\"term\":\"bliaut\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"frankish\", \"old french (842-ca. 1400)\"], \"text\":\"Old french (842-ca. 1400) \u0027bliaut\u0027 from Frankish *\u0027\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A women\u0027s overgarment worn in twelfth century Western Europe, featuring voluminous skirts and horizontal puckering or pleating across a snugly fitted underbust abdomen\", \"priority\":1}]}, \"synonyms\":{}}");

	add("blight", "{\"term\":\"blight\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old norse\"], \"text\":\"From Old norse \u0027blikna\u0027 (to grow pallid) lt;ref\u0026gt;{{R:Online Etymology Dictionary|blight}}\u0026lt;/ref\u0026gt;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"any of many plant diseases causing damage to, or the death of, leaves, fruit or other part\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the bacterium, virus or fungus that causes such a conditio\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"anything that impedes growth or development or spoils any other aspect of life\", \"priority\":3}]}, \"synonyms\":{}}");

	add("blighty", "{\"term\":\"blighty\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hindi\"], \"text\":\"corruption|Corruption of the Hindi \u0027विलायती|tr\u003dvilāyatī\u0027 (foreign) which is related to Arabic \u0027ولاية|lang\u003dar|tr\u003dwilāyah\u0027 () whence also, through Turkish, vilaye. English|vilayet.Sir Henry Yule and Arthur C. Burnell explained in their Anglo-Indian dictionary, Hobson-Jobson, published in 1886, that the word was used in the names of several kinds of exotic foreign things, especially those that the British had brought into the country, such as the aubergine, \u0027विलायती बैंगन\u0027 and especially to soda-water, which was commonly called \u0027विलायती पानी|tr\u003dvilāyatī pānī\u0027 (foreign water) Blighty was the inevitable British soldier’s corruption of it. But it only came into common use as a term for Britain at the beginning of the First World War in France about 1915. It turns up in popular songs \u0026quot;There’s a ship that’s bound for Blighty\u0026quot;, \u0026quot;We wish we were in Blighty\u0026quot;, and \u0026quot;Take me back to dear old Blighty, put me on the train for London town\u0026quot;, and in w:Wilfred Owen|Wilfred Owen\u0027s poems, as well as many other places.The sense of a minor wound comes from attributive use of the noun, as in “a Blighty wound,” “a Blighty one,” 1916.In modern Australian usage, Old has been added, as in Old Country and Old Dart, as a sentimental reference to Britain.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Great Britain, Britain, or England, especially as viewed from abroad\", \"priority\":1}]}, \"synonyms\":{}}");

	add("blimp", "{\"term\":\"blimp\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Origin not entirely certain, however most historians believe that it is onomatopoeia for the sound a blimp makes when thumped.Although there is some disagreement among historians, credit for coining the term is usually given to Lt. A.D. Conningham of the British Royal Navy in 1915.There is an often repeated, but false, alternative explanation for the term. The erroneous story is that at some time in the early 20th century, the United States military had two classes for airships: Type A-rigid and Type B-limp, hence “blimp”. In fact,: \u0027“there was no American ‘A-class’ of airships as such\u0026amp;mdash;all military aircraft, heavier or lighter-than-air were designated with ‘A’ until the appearance of B-class airships in May 1917. There was an American B airship\u0026amp;mdash;but there seems to be no record of any official designation of non-rigids as ‘limp’. Further, according to the Oxford Dictionary, the first appearance of the word in print was in 1916, in England, a year before the first B-class airship.”\u0027 (“Etymology of ‘Blimp’” by Dr. A. D. Topping, \u0027AAHS Journal\u0027, Winter 1963.)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An airship constructed with a non-rigid lifting agent container\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0027w:The New The New Yorker\u0027, 16 \u0026amp; 23 Feb 200\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Goodyear \u0027\u0027blimp\u0027\u0027 over Giants Stadiu\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An obese person\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A person similar to the cartoon character Colonel Blimp; a pompous, reactionary British man\", \"priority\":5}]}, \"synonyms\":{}}");

	add("bling", "{\"term\":\"bling\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027 January 19, w:Peter Peter Sagal, \u0027Wait, Wait...Don’t Tell Me!\u0027, w:National Public National Public Radio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Apparently also the Saudis gave him as presents fabulous \u0027\u0027bling\u0027\u0027, vast necklaces encrusted with jewels and rubies\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Ostentatious display of richness or style\", \"priority\":3}]}, \"synonyms\":{}}");

	add("blindness", "{\"term\":\"blindness\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027blindnes\u0027 from Old english (ca. 450-1100) \u0027blindnysse\u0027 morphologically as if {{suffix|blind|ness|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being blind; unable to see\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Want of intellectual or moral discernment; mental darkness; ignorance, heedlessness\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1976\u0027\u0027, Frank Herbert, \u0027Children of Dune\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A tormenting hunger shuddered through her and she wished she could put aside the power. Oh, to be as others were \u0026amp;mdash; blind in that safest of all \u0027\u0027blindnesses\u0027\u0027, living only the hypnoidal half-life into which birth-shock precipitated most humans\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"concealment\", \"priority\":5}]}, \"synonyms\":{\"list\":[{\"text\":\"ablepsy\", \"synonymQualifier\":\"RARE\"}]}}");

	add("blindside", "{\"term\":\"blindside\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|blind|side|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A driver\u0027s field of blindness around an automobile; the side areas behind the driver\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the space on the side of the pitch with the shorter distance between the breakdown/set piece and the touchline; compare openside\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"short for blindside flanker, a position in rugby union, usually number 6\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The blindside [flanker] packs down at the scrum on the blindside\", \"priority\":4}]}, \"synonyms\":{}}");

	add("blindsight", "{\"term\":\"blindsight\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|blind|sight|lang\u003den}}. Coined in a 1974 paper in the \u0027Lancet\u0027 by Sanders \u0027et al.\u0027\u0026lt;ref\u0026gt;M. D. Sanders, E. K. Warrington, J. Marshall, and L. Wieskrantz, \u0026quot;[http://www.ncbi.nlm.nih.gov/pubmed/4132425 ‘Blindsight’: Vision in a field defect],\u0026quot; \u0027Lancet\u0027, vol. 1, no. 7860 (20 Apr. 1974), pp. 707-8.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The responsivity shown by some blind or partially blind people to visual stimuli of which they are not consciously aware\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, w:Lawrence Lawrence Weiskrantz, \u0026quot;Unconscious Vision: The Strange Phenomenon of \u0027\u0027Blindsight\u0027\u0027,\u0026quot; \u0027The Sciences\u0027, vol. 32, no. 5, p. 23\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"On more pointed testing Sanders and I, along with the National Hospital psychologist Elizabeth K. Warrington, discovered to our amazement that Daniel\u0027s \u0026quot;blind\u0026quot; field was not blind at all in the usual sense. . . . When objects were placed in his blind field, he made virtually no errors locating them, though he could not tell us what they were. . . . \u0026quot;I couldn\u0027t see anything, not a darn thing,\u0026quot; Daniel told us. All he would allow was a \u0026quot;feeling\u0026quot; about an object in some, but not all, [of] the tests. We named the extraordinary phenomenon \u0027\u0027blindsight\", \"priority\":3}]}, \"synonyms\":{}}");

	add("blinkie", "{\"term\":\"blinkie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|blink|ie|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small animated graphic for use on a webpage, usually taking the form of a picture or phrase with blinking lights around it\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Lisa Nakamura, \u0027Digitizing Race: Visual Cultures of the Internet\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The buddyicon.info Web site offers thousands of AIM buddy icons (28838 by my most recent count), as well as \u0026quot;away\u0026quot; icons and \u0026quot;\u0027\u0027blinkies\u0027\u0027\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Joelle Reeder, Katherine Scoleri, \u0027The IT Girl\u0027s Guide to Blogging with Moxie\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"You want people to be able to find your entries; try to keep the extra bling, like distracting scripts and \u0027\u0027blinkies\u0027\u0027, to a minimum\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Kim Golombisky, Rebecca Hagen, \u0027White Space is Not Your Enemy\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Don\u0027t animate your visuals to blink ad infinitum. Set a small-file \u0027\u0027blinkie\u0027\u0027 to turn off after no more than three passes at whatever it is your blinkie does\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A coupon dispenser with blinking lights to draw the attention of shoppers\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Kasey Knight Trenum, \u0027Couponing for the Rest of Us\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"These are \u0027\u0027blinkies\u0027\u0027. When you walk up to them there is usually a coupon sticking out. Snag the coupon and another one just like it will pop out in a few seconds. Blinkies have a special place in my heart\", \"priority\":10}]}, \"synonyms\":{}}");

	add("bliss", "{\"term\":\"bliss\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|bliss}}, from Old english (ca. 450-1100) \u0027bliss\u0027 variant of earlier {{m|ang|blīds}}, {{m|ang|blīþs||joy, gladdness}}, from Proto-germanic {{m|gem-pro|*blīþisjō||joy, goodness, kindness}}. Cognate with Old Saxon {{m|osx|blīthsia}}, {{m|osx|blīdsea}}, {{m|osx|blizza||joy, jubilation}}. Related to {{m|en|blithe}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"perfect happiness\", \"priority\":1}]}, \"synonyms\":{}}");

	add("blissdom", "{\"term\":\"blissdom\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|bliss|dom|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The world, sphere, influence, or state of bliss; blissfulness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Danielle LaPorte, \u0027The Fire Starter Sessions\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Walk through everything that would go into the waking hours of \u0027\u0027blissdom\u0027\u0027 for you\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Vicki Courtney, \u0027Ever After: Life Lessons Learned in My Castle of Chaos\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In the end, we were left with a June Cleaver-like prototype of domestic Leave-It-to-Beaver suburban \u0027\u0027blissdom\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, People I Want to Punch in the Throat, ‎Baby Sideburns, ‎Insane in the Mom Brain, \u0027I Just Want to Pee Alone\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Then my day of \u0027\u0027blissdom\u0027\u0027 arrived when my beauties both were enrolled in full day grade school! Oh, yes I missed them terribly and cried on the first day blah, blah, blah but I soon got over it when I first soloed at the market\", \"priority\":7}]}, \"synonyms\":{}}");

	add("blissymbols", "{\"term\":\"blissymbols\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|Bliss|symbols|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A constructed language using ideographs invented by Charles K. Bliss after the Second World War\", \"priority\":1}]}, \"synonyms\":{}}");

	add("blister", "{\"term\":\"blister\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027blestre\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small bubble between the layers of the skin that contains watery or bloody fluid and is caused by friction and pressure, burning, freezing, chemical irritation, disease or infection\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Grainge\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Painful \u0027\u0027blisters\u0027\u0027 swelled my tender hands\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A swelling on a plant\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Something applied to the skin to raise a blister; a vesicatory or other applied medicine\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1819\u0027\u0027, Lord Byron, \u0027Don Juan\u0027, I.168\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"T is written in the Hebrew Chronicle, / How the physicians, leaving pill and potion, / Prescribed, by way of \u0027\u0027blister\u0027\u0027, a young belle, / When old King David\u0027s blood grew dull in motion, / And that the medicine answered very well\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A bubble, as on a painted surface\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An enclosed pocket of air, which may be mixed with water or solvent vapor, trapped between impermeable layers of felt or between the membrane and substrate\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A type of pre-formed packaging made from plastic that contains cavitie\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"blister\u0027\u0027 card\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"blister\u0027\u0027 pack\", \"priority\":12}]}, \"synonyms\":{}}");

	add("blite", "{\"term\":\"blite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The plant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of various plants in the genus \u0027Chenopodium\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any of various plants in the genus \u0027Atriplex\", \"priority\":3}]}, \"synonyms\":{}}");

	add("blitz", "{\"term\":\"blitz\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\"], \"text\":\"Shortened from \u0027blitzkrieg\u0027, from German\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sudden , especially an ; usually with reference to The Blitz\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A sudden effort\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a publicity \u0027\u0027blitz\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The action of a defensive football player who rushes the passer of the football\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"blitz Blitz chess, a form of chess with a short time limit for moves\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A swift and overwhelming attack\", \"priority\":6}]}, \"synonyms\":{}}");

	add("blitz", "{\"term\":\"blitz\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Short for \u0027Blitzkrieg\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The series of air raids launched on various cities in Great Britain by the German air force in 1940-41 during World War II. They were also known as the Baedeker Raids\", \"priority\":1}]}, \"synonyms\":{}}");

	add("blitter", "{\"term\":\"blitter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|blit|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A software or hardware mechanism that blits\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027, \u0027InfoWorld\u0027 (volume 8, number 49, 8 December 1986, page 46\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Not only is the Amiga \u0027\u0027blitter\u0027\u0027 fully integrated with and supported by the system as a whole, it also has access to its own direct memory channel\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, André LaMothe, \u0027Tricks of the Windows Game Programming Gurus\u0027 (page 315\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Using the hardware \u0027\u0027blitter\u0027\u0027 to move bitmaps from VRAM to VRAM is much faster than moving them from system memory to VRAM\", \"priority\":5}]}, \"synonyms\":{}}");

	add("blivet", "{\"term\":\"blivet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Anything overfull\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An item of unknown purpose, often unnecessary or useless or annoying\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A program that has been worked on by many poorly skilled programmers and is now a mess\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An electronic signal that is normally high or on, but goes low for a very short period and then returns to high. A low going spike\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A hammer sometimes used by geologists to chop rock samples from boulders for examination\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A hammer used by electric welders to knock off slag off of the welded joint. Such blivet hammers sometimes have springs for handles instead of solid wood or plastic to lessen shock to the human hands\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A container/tank for refrigerant gas\", \"priority\":7}]}, \"synonyms\":{}}");

	add("blizzard", "{\"term\":\"blizzard\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{unk.|en}}{{attention|en|Could someone please look at the following... it seems kind of encyclopedic, but I defer judgement.}}{{rel-top|Etymology Theories}}* The earliest written use of blizzard as a term to describe a severe snow storm, spelled \u0026quot;blizard\u0026quot; was in the W:Estherville, Iowa|Estherville, Iowa, \u0027Northern Vindicator\u0027 on 23 April 1870. O.C. Bates \u0026lt;ref\u0026gt;{{cite book|author\u003dGaraeme Donald|title\u003dFighting TalkGeneral Military|date\u003d2008|url\u003dhttp://books.google.com/books?id\u003dWM6qJuAnzq4C\u0026amp;pg\u003dPA48\u0026amp;dq\u003d%22snowstorm+an+Americanism%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ddrLNVJCFDta2oQT34IGQBw\u0026amp;ved\u003d0CCUQ6AEwA. v\u003donepage\u0026amp;q\u003do.c.%20bates\u0026amp;f\u003dfalse|page\u003d49|access-date\u003dFeb 21, 2015|isbn\u003d1846034558}}\u0026lt;/ref\u0026gt; neologistic editor of The Northern Vindicator used it for the terrific snowstorms in the state that spring. He claimed he had picked up the term from -locals characterizing a \u0026quot;Lightning Ellis\u0026quot;, on account of his violent out bursts. One week later it appeared again in the same newspaper, only with the now common double-z spelling.:* Blizzard possibly comes from the surname \u0026quot;Blizzard\u0026quot; dating back to 1700\u0027s(?). \u0027Blizzard\u0027 surname possibly comes from the \u0027blizzard\u0027 one, dating back to the 1500\u0027s(?).:* The word blizzard was used (not in relation to the weather) in America prior to 1870. It had various, roughly associated, now obsolete meanings: : •Blast with a firearm or cannon \u0026lt;ref\u0026gt;{{ cite book|author\u003dDavy Crockett|title\u003dDavy Crockett Almanack|date\u003d1834|url\u003dhttp://books.google.com/books?id\u003df2k3kgAACAAJ\u0026amp;dq\u003dDavy+Crockett\u0027s+Almanack\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d50HlVKeDE8G_ggTGqYDoDA\u0026amp;ved\u003d0CAoQ6AEwAA|access-date\u003dFeb 21, 2015|isbn\u003dunknown}}\u0026lt;/ref\u0026gt; (whether one or multiple bullets or pellets uncertain): •Verbal blast \u0026lt;ref\u0026gt;{{cite book|author\u003dDavy Crockett|title\u003dAn Account of Col. Crockett\u0027s Tour to the North and Down East: In the Year of Our Lord One Thousand Eight Hundred and Thirty-four. His Object Being to Examine the Grand Manufacturing Establishments of the Country; and Also to Find Out the Condition of Its Literature and Morals, the Extent of Its Commerce, and the Practical Operation of \u0026quot;The Experiment\u0026quot;, Davy Crockett|date\u003d1835|url\u003dhttps://books.google.com/books?id\u003do51x5N-FZcoC\u0026amp;printsec\u003dfrontcover\u0026amp;dq\u003dtour+down+east\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dEETlVK_8Fsm6ggSDjoC4Aw\u0026amp;ved\u003d0CBgQ6AEwA. v\u003donepage\u0026amp;q\u003dblizzard\u0026amp;f\u003dfalse|page\u003d19|access-date\u003dFeb 21, 2015|isbn\u003dunknown}}\u0026lt;/ref\u0026gt;: •Blast with a firearm or cannon \u0026lt;ref\u0026gt;{{cite book|author\u003d\u0026lt;!--Staff writer(s); no by-line.--\u0026gt;|title\u003dA Dictionary of Slang, Jargon \u0026amp; Cant Embracing English, American, and Anglo-Indian Slang, Pidgin English, Gypsies\u0027 Jargon and Other Irregular Phraseology, Volume 1|date\u003d1897|editor1-last\u003dBarrère|editor1-first\u003dAlbert|editor2-last\u003dLeland|editor2-first\u003dCharles Godfrey|display-editors\u003d2|url\u003dhttps://books.google.com/books?id\u003det7WAAAAMAAJ\u0026amp;pg\u003dPA129\u0026amp;dq\u003d%22blizzard+american+a+word%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dD8XJVP3GOs21ogSi1YKoDA\u0026amp;ved\u003d0CCgQ6AEwA. v\u003donepage\u0026amp;q\u003d%22blizzard%20american%20a%20word%22\u0026amp;f\u003dfalse|page\u003d129|access-date\u003dFeb 21, 2015|isbn\u003dunknown}}\u0026lt;/ref\u0026gt; (single ball or bullet):: •Blazing fire \u0026lt;ref\u0026gt;{{cite book|author\u003dJoseph Jones|title\u003dMajor Jones\u0027s Scenes in GeorgiaVolume 25 of American humorists seriesForeign Book and Serial Vendors Directories|date\u003d1843|url\u003dhttps://books.google.com/books?id\u003dt-ksGlUTcagC\u0026amp;pg\u003dPA153\u0026amp;dq\u003d%22blizzard+of+my+soul%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d_ZfMVILIDMm5ogTYxoKQDw\u0026amp;ved\u003d0CD8Q6AEwB. v\u003donepage\u0026amp;q\u003d%22blizzard%20of%20my%20soul%22\u0026amp;f\u003dfalse|page\u003d153|access-date\u003dFeb 21, 2015|isbn\u003d0839819560}}\u0026lt;/ref\u0026gt;: •Heavy or painful physical blow \u0026lt;ref\u0026gt;{{cite news|date\u003dAugust 25, 1849|editor1-last\u003dJohnson|editor1-first\u003dOliver|title\u003dDiabolical Outrage|language\u003denglish|newspaper\u003dAnti-slavery Bugle|vol\u003d4|issue\u003d52|location\u003dSalem, Ohio|publisher\u003dExecutive Committee of the Western Anti-slavery Society|page\u003d3|archive-url\u003dhttp://chroniclingamerica.loc.gov/lccn/sn83035487/1849-08-25/ed-1/seq-3. date1\u003d1836\u0026amp;sort\u003drelevance\u0026amp;rows\u003d20\u0026amp;words\u003dblizzard\u0026amp;searchType\u003dbasic\u0026amp;sequence\u003d0\u0026amp;index\u003d8\u0026amp;state\u003d\u0026amp;date2\u003d1869\u0026amp;proxtext\u003dblizzard\u0026amp;y\u003d12\u0026amp;x\u003d19\u0026amp;dateFilterType\u003dyearRange\u0026amp;page\u003d5|issn\u003d2166-1863|access-date\u003dFeb 21, 2015}}\u0026lt;/ref\u0026gt; (not involving a firearm): •Literal or figurative attack \u0026lt;ref\u0026gt;{{cite news|date\u003dJuly 29, 1851|title\u003d~Whig Candidate for Floater!~ To Your Tents, Oh! Israel!|language\u003denglish|newspaper\u003dFayetteville Observer|vol\u003d1|issue\u003d1|location\u003dFayetteville, Tennessee|publisher\u003dAlfred H. Berry|page\u003d3|achieve-url\u003dhttp://chroniclingamerica.loc.gov/lccn/sn85033395/1851-07-29/ed-1/seq-3. date1\u003d1836\u0026amp;sort\u003drelevance\u0026amp;rows\u003d20\u0026amp;words\u003dblizzards\u0026amp;searchType\u003dbasic\u0026amp;sequence\u003d0\u0026amp;index\u003d1\u0026amp;state\u003d\u0026amp;date2\u003d1869\u0026amp;proxtext\u003dblizzard\u0026amp;y\u003d12\u0026amp;x\u003d19\u0026amp;dateFilterType\u003dyearRange\u0026amp;page\u003d15|issn\u003d2328-0956|access-date\u003dFeb 21, 2015}}\u0026lt;/ref\u0026gt;: •Exclamation \u0026lt;ref\u0026gt;{{cite news|date\u003dNovermber 5, 1853|editor1-last\u003dSiegfried|editor1-first\u003dS.|editor2-last\u003dSiegfried|editor2-first\u003dS. Jr|title\u003dPocketbook Found|language\u003denglish|newspaper\u003dMongolia Mirror|vol\u003d5|issue\u003d122|location\u003dMorgantown, Virginia|publisher\u003dSimeon Siegfried, Sr.|page\u003d1|archive-url\u003dhttp://chroniclingamerica.loc.gov/lccn/sn86092163/1853-11-05/ed-1/seq-1. date1\u003d1836\u0026amp;sort\u003drelevance\u0026amp;rows\u003d20\u0026amp;words\u003dblizzards\u0026amp;searchType\u003dbasic\u0026amp;sequence\u003d0\u0026amp;index\u003d15\u0026amp;state\u003d\u0026amp;date2\u003d1869\u0026amp;proxtext\u003dblizzard\u0026amp;y\u003d12\u0026amp;x\u003d19\u0026amp;dateFilterType\u003dyearRange\u0026amp;page\u003d14|issn\u003d2374-2178|access-date\u003dFeb 21, 2015}}\u0026lt;/ref\u0026gt;(like “the blazes” or “blue blazes\u0026quot;): •Blast with multiple firearms or with a firearm loaded with multiple pellets \u0026lt;ref\u0026gt;{{cite news|author-last\u003dPeddler|author-first\u003dA Book|date\u003dNovember 15, 1860|editor1-last\u003dCaskey|editor1-first\u003dJ.|title\u003dLife in Egypt|language\u003denglish|newspaper\u003dHolms County Republican|vol\u003d5|issue\u003d13|location\u003dMillsburg, Ohio|publisher\u003dJ. Caskey|page\u003d1|archive-url\u003dhttp://chroniclingamerica.loc.gov/lccn/sn84028820/1860-11-15/ed-1/seq-1. date1\u003d1836\u0026amp;sort\u003drelevance\u0026amp;rows\u003d20\u0026amp;words\u003dblizzard\u0026amp;searchType\u003dbasic\u0026amp;sequence\u003d0\u0026amp;index\u003d6\u0026amp;state\u003d\u0026amp;date2\u003d1869\u0026amp;proxtext\u003dblizzard\u0026amp;y\u003d12\u0026amp;x\u003d19\u0026amp;dateFilterType\u003dyearRange\u0026amp;page\u003d5|issn\u003d2166-5672|access-date\u003dFeb 21, 2015}}\u0026lt;/ref\u0026gt;: •Shot of liquor \u0026lt;ref\u0026gt;{{cite news|date\u003dSeptember 21 1870|editor1-last\u003dRow|editor1-first\u003dS. J.|language\u003denglish|title\u003dRaftsman\u0027s Journal|newspaper\u003dRaftsman\u0027s Journal|location\u003dClearfield Pennsylvania|publisher\u003dBen. Jones|Page\u003d2|archive-url\u003dhttp://chroniclingamerica.loc.gov/lccn/sn85054616/1870-09-21/ed-1/seq-2. date1\u003d1869\u0026amp;sort\u003drelevance\u0026amp;rows\u003d20\u0026amp;words\u003dblizzard+Blizzard\u0026amp;searchType\u003dbasic\u0026amp;sequence\u003d0\u0026amp;index\u003d5\u0026amp;state\u003d\u0026amp;date2\u003d1870\u0026amp;proxtext\u003dblizzard\u0026amp;y\u003d15\u0026amp;x\u003d19\u0026amp;dateFilterType\u003dyearRange\u0026amp;page\u003d2|issn\u003dissn\u003d2330-846X|access-date\u003dFeb 21 2015}}\u0026lt;/ref\u0026gt;:* Probably from the German \u0027blitzartig\u0027 (lang\u003dde) * Another version suggests French blesser (to wound) \u0026lt;ref\u0026gt;{{cite book|author\u003dCraig M. Carver|date\u003d1991|title\u003dA History of English in Its own words|url\u003dhttps://books.google.com/books?id\u003dYbpZAAAAMAAJ\u0026amp;q\u003d%22I+took+a+blizzard+at+one%22\u0026amp;dq\u003d%22I+took+a+blizzard+at+one%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dv0fMVMndB8jToATd1oD4BQ\u0026amp;ved\u003d0CCoQ6AEwAzgK|page\u003d202|access-date\u003dFeb 21 2015|isbn\u003d0062700138}}\u0026lt;/ref\u0026gt;, but neither this nor the German can be substantiated. Yet another claims that blizzard derives from English dialect blizzer, meaning \u0026quot;a blaze\u0026quot; or \u0026quot;flash\u0026quot; (\u0026quot;Put towthry sticks on th\u0027 fire, an\u0027 let\u0027s have a blizzer,\u0026quot; - The English Dialect Dictionary) \u0026lt;ref\u0026gt;{{cite book|author\u003dJoseph Wright|date\u003d1898|title\u003dThe English Dialect Dictionary|url\u003dhttps://books.google.com/books?id\u003doEMOAQAAMAAJ\u0026amp;pg\u003dPR16\u0026amp;dq\u003d%22English+Dialect+Society%22+Nottinghamshire\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dSaTNVICRHYbioASAgIGADA\u0026amp;ved\u003d0CCQQ6AEwA. v\u003donepage\u0026amp;q\u003dblizzer\u0026amp;f\u003dfalse|page\u003d303|access-date\u003dFeb 21 2015|isbn\u003d1113929766}}\u0026lt;/ref\u0026gt; or from blazer (something that blazes or blasts), which gave the early sense \u0026quot;a volley of firing guns,\u0026quot; that is, a general \u0026quot;blazing away.\u0026quot; :* [https://books.google.com/books?id\u003d9GECAAAAIAAJ\u0026amp;pg\u003dPA217\u0026amp;dq\u003d%22blizzer%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d9MrJVJHZN8zeoASjmoCYCg\u0026amp;ved\u003d0CEIQ6AEwB. v\u003donepage\u0026amp;q\u003d%22blizzer%22\u0026amp;f\u003dfalse Thomas Ratcliffe of Worksop, Nottinghamshire, in the March 17, 1888, edition]BLIZZARD (7th S. v. 106).—The word blizzard is well known through the Midlands, and its cognates are fairly numerous. I have known the word and its kin fully thirty years. Country folk use the word to denote blazing, blasting, blinding, dazzling, or stifling. One who has had to face a severe storm of snow, hail, rain, dust, or wind, would say on reaching shelter that he has \u0026quot;faced a blizzer,\u0026quot; or that the storm was \u0026quot;a regular blizzard.\u0026quot; A blinding flash of lightning would call forth the exclamation, \u0026quot;My! that wor a blizzomer!\u0026quot; or \u0026quot;That wor a blizzer!\u0026quot; \u0026quot;Put towthry sticks on th\u0027 fire, an let\u0027s have a blizzer\u0026quot;—a blaze. \u0026quot;A good blizzom\u0026quot; \u003d a good blaze. \u0026quot;That tree is blizzared\u0026quot; \u003d blasted, withered. As an oath the word is often used, and \u0026quot;May I be blizzerded\u0026quot; will be readily understood.:* A check of some of the Midlands regional glossaries printed in the 1800s finds several entries for blizzy. First, from Anne Baker, Glossary of Northamptonshire words and phrases (1854): \u0026lt;ref\u0026gt;{{cite book|author\u003dAnne Baker|title\u003dGlossary of Northamptonshire words and phrases vol. 1|date\u003d1854|url\u003dhttps://books.google.com/books?id\u003dbe8IAAAAQAAJ\u0026amp;pg\u003dPA57\u0026amp;dq\u003d%22Blizzy%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dStrJVMTOGszzoAS6l4Jw\u0026amp;ved\u003d0CCwQ6AEwAzg. v\u003donepage\u0026amp;q\u003d%22Blizzy%22\u0026amp;f\u003dfalse|page\u003d57|access-date\u003dFeb 21, 2015|isbn\u003d1152470914}}\u0026lt;/ref\u0026gt; BLIZZY. A blaze. \u0026quot;Blow the fire, and let\u0027s have a nice blizzy.\u0026quot; This, though now considered a vulgarism, is a retention of the original A.-Sax. blysa, a blaze.And Angelina Parker, A Glossary of Words Used in Oxfordshire (1876): \u0026lt;ref\u0026gt;{{cite book|author\u003dAngalina Parker|title\u003dA Glossary of Words Used in Oxfordshire|date\u003d1876|url\u003dhttps://books.google.com/books?id\u003diIAHAAAAQAAJ\u0026amp;pg\u003dPA114\u0026amp;dq\u003d%22Blizzy%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dStrJVMTOGszzoAS6l4Jw\u0026amp;ved\u003d0CCEQ6AEwATg. v\u003donepage\u0026amp;q\u003d%22Blizzy%22\u0026amp;f\u003dfalse|page\u003d114|access-date\u003dFeb 21 2015|isbn\u003d117864894X}}\u0026lt;/ref\u0026gt; Blizzy, a flaring fire produced by putting on small sticks. Ex. \u0027Let\u0027s \u0027a a bit of a blizzy afore us goes to bed.\u0027 And from Barzillai Lowsley, A Glossary of Berkshire Words and Phrases (1888): \u0026lt;ref\u0026gt;{{cite book|author\u003dBarzillai Lowsley|title\u003dA Glossary of Berkshire Words and Phrases|date\u003d1888|url\u003dhttps://books.google.com/books?id\u003dHKITAAAAQAAJ\u0026amp;pg\u003dPA50\u0026amp;dq\u003d%22Blizzy%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d-NnJVOiGK5TVoASR_IHYCA\u0026amp;ved\u003d0CFUQ6AEwC. v\u003donepage\u0026amp;q\u003d%22Blizzy%22\u0026amp;f\u003dfalse|page\u003d80|access-date\u003dFeb 21 2015|isbn\u003d1248484231}}\u0026lt;/ref\u0026gt;BLIZZY.— A blaze. The fire is said to be all of a \u0026quot;blizzy\u0026quot; when pieces of wood have been inserted amongst the coal to make it burn cheerfully. And from G. F. Northall, A Warwickshire Word-book (1896): \u0026lt;ref\u0026gt;{{cite book|author\u003dG. F. Northall|title\u003dA Warwickshire Word-book|date\u003d1896|url\u003dhttps://books.google.com/books?id\u003dZy4_AAAAYAAJ\u0026amp;pg\u003dPA31\u0026amp;dq\u003d%22Blizzy%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d-NnJVOiGK5TVoASR_IHYCA\u0026amp;ved\u003d0CD8Q6AEwB. v\u003donepage\u0026amp;q\u003d%22Blizzy%22\u0026amp;f\u003dfalse|page\u003d31|access-date\u003dFeb 21 2015}}\u0026lt;/ref\u0026gt;Blizzy, sb. A blaze, a blast, a flare of fire. A.-Sax. blysa, a blaze. Common.They suggest that blizzy survived from the ancient word blysa in numerous localities and might well share a root with the U.S. blizzard. {{rel-bottom}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A severe snowstorm, especially with strong winds and greatly reduced visibility\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A large amount of paperwork\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A large number of similar things\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/books-and-arts/21579801-making-sense-statistics-riddle-our-days-snakes-and-ladders Snakes and passage\u003dRisk is everywhere.For each one there is a frighteningly precise measurement of just how likely it is to jump from the shadows and get you. “The Norm Chronicles”aims to help data-phobes find their way through this \u0027\u0027blizzard\u0027\u0027 of risks\", \"priority\":4}]}, \"synonyms\":{}}");

 	}  	private static void add(String term, String json) { 		map.put(term, GsonUtils.toObject(json, Entry.class)); 	}  	public static Entry get(String term) { 		return map.get(term); 	}  	public static boolean has(String term) { 		return null != get(term); 	}  	public static Collection<String> terms() { 		return map.keySet(); 	} }